function handler(params) {
  const orderDetails = params.data.steps.loopOverOrders.loopOverItem;

  const flattenedRow = [
    orderDetails.id || "",                                     // Order ID
    orderDetails.name || "",                                   // Order Name
    orderDetails.financial_status || "",                       // Payment Status
    orderDetails.processed_at || "",                           // Order Date
    orderDetails.subtotal_price || "",                         // Subtotal
    orderDetails.total_price || "",                            // Total
    orderDetails.currency || "",                               // Currency
    orderDetails.email || "",                                  // Customer Email
    orderDetails.line_items?.[0]?.name || "",                  // First Item Name
    orderDetails.line_items?.[0]?.price || "",                 // First Item Price
    orderDetails.line_items?.[0]?.quantity || "",              // First Item Quantity
    orderDetails.shipping_address?.address1 || "",             // Shipping Address
    orderDetails.shipping_address?.city || "",
    orderDetails.shipping_address?.country || ""
  ];
  let flag = true;
  if (orderDetails.financial_status === "paid") {
    flag = false;
  }
  return {
    flattenedRow: flattenedRow,
    flag: flag
  };
}

